INSERT INTO ascendco.sonar_backlog (            backlog_date,            backlog_day_name,            backlog_day_of_week,            backlog_hour_bin,            backlog_hour_of_day,            backlog_local,            backlog_month,            backlog_month_no,            backlog_year,            backlog_year_no,            backlog_dts,            clean_backlog,            clean_inst_backlog,            date_hour,            date_time,            dirty_backlog,            dirty_inst_backlog,            facility_id,            facility_name,            hsys_id,            hsys_name,            overall_backlog,            overall_inst_backlog)      SELECT              expanded_data."Backlog_Date",             expanded_data."Backlog_DayName",             expanded_data."Backlog_DayOfWeek",             expanded_data."Backlog_HourBin",             expanded_data."Backlog_HourOfDay",             expanded_data."Backlog_Local",             expanded_data."Backlog_Month",             expanded_data."Backlog_MonthNo",             expanded_data."Backlog_Year",             expanded_data."Backlog_YearNo",             expanded_data."BacklogDTS",             expanded_data."CleanBacklog",             expanded_data."CleanInstBacklog",             expanded_data."DateHour",             expanded_data."DateTime",             expanded_data."DirtyBacklog",             expanded_data."DirtyInstBacklog",             expanded_data."FacilityID",             expanded_data."FacilityName",             expanded_data."HsysID",             expanded_data."HsysName",             expanded_data."OverallBacklog",             expanded_data."OverallInstBacklog"        FROM domo_passthrough  CROSS JOIN jsonb_to_recordset(domo_passthrough.data) as expanded_data (             "Backlog_Date" date,             "Backlog_DayName" citext,             "Backlog_DayOfWeek" int4,             "Backlog_HourBin" int4,             "Backlog_HourOfDay" int4,             "Backlog_Local" citext,             "Backlog_Month" citext,             "Backlog_MonthNo" int4,             "Backlog_Year" citext,             "Backlog_YearNo" int4,             "BacklogDTS" timestamp,             "CleanBacklog" int4,             "CleanInstBacklog" int4,             "DateHour" citext,             "DateTime" citext,             "DirtyBacklog" int4,             "DirtyInstBacklog" int4,             "FacilityID" uuid,             "FacilityName" citext,             "HsysID" uuid,             "HsysName" citext,             "OverallBacklog" int4,             "OverallInstBacklog" int4)       WHERE dataset_name = 'Sonar_Backlog_PG' AND             view_version = '2'